import React, { useState } from "react";
import { BsArrowLeftCircleFill, BsArrowRightCircleFill } from "react-icons/bs";

import "./Carousel.css";

export const Carousel = ({ data }) => {
  
  return (
    <div>
{data.map((item, idx) => {
      return (
        <img
        src={item.image}
        alt={item.alt}
        key={idx}
        
        />
        );
      })}
    </div>
  )}
